  false,\n\t\"url\": null,\n\t\"notes\": \"This data set consists of moored Upward
  Looking Sonar (ULS) data from 14 stations in the Weddell Sea. Parameters in the
  processed data files are water pressure, water temperature, draft, and a flag to
  indicate if the instrument is under ice. Raw data files contain additional parameters.
  These data were contributed by the Alfred Wegener Institute for Polar and Marine
  Research, Bremerhaven, Germany, in 1999. Data are available via ftp.\",\n\t\"license_title\":
